import * as React from "react";
import {Container, Paper} from "@mui/material";
import Box from "@mui/material/Box";

export default function PlaceInformation() {

    const paperStyle = {
        padding: "50px 20px",
        width: "95%",
        margin: "20px auto",
        borderRadius: 20,
        backgroundColor: "#e9dbd3"
    }

    const htmlContent = `
    <!DOCTYPE html>
    <html xmlns="http://www.w3.org/1999/xhtml">
    <head>
        <title>Быстрый старт. Размещение интерактивной карты на странице</title>
        <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />
        <script src="https://api-maps.yandex.ru/2.1/?apikey=fe3d6ecd-6130-445d-9be8-90aef6f5c35f&lang=ru_RU" type="text/javascript">
        </script>
        <script type="text/javascript">
            ymaps.ready(init);
            function init(){
                var myMap = new ymaps.Map("map", {
                    center: [55.76, 37.64],
                    zoom: 7
                });
            }
        </script>
    </head>

    <body>
    <div id="map" style="width: 600px; height: 400px"></div>
    </body>

    </html>
  `;

    return (
        <Container>
            <Paper elevation={3} style={paperStyle}>
                <Box>
                    <h1>Место Проведения</h1>

                    <h3 className="textContent" style={{fontSize: "2rem"}}>
                        "Villa Небеса"
                        <tr/>
                        Ул. Техническая, 4б
                    </h3>

                    <div style={{width: "600px", height: "400px"}} dangerouslySetInnerHTML={{ __html: htmlContent }}>
                    </div>

                </Box>
            </Paper>
        </Container>
    );
}
